import './App.css';
import Greet from './Components/Headernav/greet';
import Welcome from './Components/Headernav/Welcome';
import { Button } from '@material-ui / icons'
function App() {
  return (
    <div className="App">
      <Greet />
      <Welcome />
      <button>Normal button</button>
      <Button> My button</Button>
    </div>
  );
}

export default App;
